import ExpenseItem from './ExpenseItem'
import './Expenses.css'

function Expenses(props) {
    return (
        <div>
            <h1>Let's get started!</h1>
            {props.items.map(item => (
                <div className="expenses" key={item.id}>
                    <ExpenseItem
                        title={item.title}
                        amount={item.amount}
                        date={item.date}
                    />
                </div>
            ))}
        </div>
    )
}

export default Expenses;
